어이~ 신율! 살아 있나, 지금 이 편지 읽고 있어..? 
만주로 떠나기 전 물건들을 정리하다가 내게 가장 소중했던
세 가지 물건들을 너에게 맡기기로 했어.

혹시.. 이 타자기 처음 봤던 날이 생각나?.. 
실은 그때 만연필 하나면 족하다고 한 거 진심이 아니었어. 허세였어. 
너에게 타자기를 선물받고 얼마나 기뻤는지..
너에게 받은 게 너무 많은데..
살아서는 못 갚을 만큼 너무나 많이 받았는데..
어쩌면 살아서는 다시 못 볼 길을 떠나는 지금, 너에게 줄 게 이거 밖에 없어서.. 미안하다..

그나마 그냥은 못 주고 부탁을 얹어 보려고 하는데.. 감당이 될까..
니가 내 대신 못다쓴 이 소설을 완성해주길 바래. 
니가 나한테 선물했던 이 타자기로.
나를 대신해서 이번엔 니가 우리들의 이야기를 써줘.

그 시절, 우리가 이땅에 살았었다고. 
암흑 같은 현실 속에서도 열심히 살아가고 치열하게 아파하고, 절망 속에서 희망을, 위험 속에서도 행복을 찾아가며 온 힘을 다해 사랑하고 투쟁해왔다고.

회중시계는 1분 1초 멈추지 말고 성실하게 수현이를 아껴주길 바란다는 뜻이야. 
다신 수현이가 혼자되지 않도록 니가 그 곁을 지켜줘. 

마지막으로 율아, 내가 널 얼마나 믿고
우애했는지 미처 말로 전하지 못한게 후회가 돼.
그러니까 우리 꼭 살아서 만나자.
아니, 죽어서라도, 다시 만나자. 

만약 신께서 내게 이번 생에 행복했었냐고 물으시면 대답할거야.
너희들을 만나 행복했었다고.
혹여 신께서 내게 사느라 고생했다 참 잘 살았다 어깨를 두드려 주시면 부탁해볼거야.

다시 태어난다면
그때도 너희들과 함께이게 해달라고...

ㅡㅡㅡㅡㅡㅡㅡㅡㅡ

청춘을 바쳐준 독립투사분들 덕분에
지금 우리가 이렇게..
내가 근대 골목을 좋아하는 이유ㅡ

